	[Theory]
	[InlineData("")]
	[InlineData("")]
	[InlineData("Zm9vYmFy")]

	public void IsBase64String_ValidBase64_ReturnTrue(string base64)
	{
		// Act
		bool result = FileUtil.IsBase64String(base64);

		// Assert
		result.Should().BeTrue();
	}

	[Theory]
	[InlineData(null)]
	[InlineData("")]
	[InlineData(" ")]
	[InlineData("\t")]
	[InlineData("Zm9vYmFy!")]
	public void IsBase64String_InvalidBase64_ReturnFalse(string base64)
	{
		// Act
		bool result = FileUtil.IsBase64String(base64);

		// Assert
		result.Should().BeFalse();
	}

