	[Theory]
	[InlineData(null)]
	[InlineData("")]
	[InlineData(" ")]
	[InlineData("\t")]
	[InlineData(@"C:\Windows\System32\notepad.exe")]
	[InlineData(@"my folder\my file.txt")]
	[InlineData("my*file?.txt")]
	[InlineData(@"my""file.txt")]
	[InlineData("my<file.txt")]
	[InlineData("my>file.txt")]
	[InlineData("my|file.txt")]
	[InlineData("file")]
	[InlineData("file.")]
	[InlineData("file#gg.jpg")]
	public void IsContentType_InvalidContentTypes_ReturnsFalse(string fileName)
	{
		// Act
		bool result = FileUtil.IsContentType(fileName);

		// Assert
		result.Should().BeFalse();
	}

	[Theory]
	[InlineData("myfile.txt")]
	[InlineData("my-file.txt")]
	[InlineData("my_file.txt")]
	[InlineData("my file.txt")]
	[InlineData("file.longextension")]
	public void IsFileName_ValidName_ReturnsTrue(string fileName)
	{
		// Act
		bool result = FileUtil.IsFileName(fileName);

		// Assert
		Assert.True(result);
	}

